import React from "react";
import Cards from "./components/Cards";
import seriesData from "./components/SData";

{/* function SeriesCard(val){
  return(
    <Cards
      imgSrc = {val.imgSrc}
      ottPf = {val.ottPf}
      seriesName = {val.seriesName}
      imdb = {val.imdb}
      srcLink = {val.srcLink}
    />
  )
} */}

function App() {
  return (
    <>
      <h1 className="heading">Collection of My Best Web Series </h1>
      {seriesData.map((val)=> {
        return(
          <Cards
            imgSrc = {val.imgSrc}
            ottPf = {val.ottPf}
            seriesName = {val.seriesName}
            imdb = {val.imdb}
            srcLink = {val.srcLink}
          />
        );
      })
    }
    </>
  )
}

export default App;
